    static func generateContainer(incomeCategoriesCount: Int = 3, expenseCategoryCount: Int = 3, accountsCount: Int = 3, transactionCount: Int = 3) -> ModelContainer {
        
        func randomDate(from startDate: Date, to endDate: Date) -> Date? {
            guard startDate <= endDate else { return nil } // Ensure the start date is before the end date
            let timeInterval = endDate.timeIntervalSince(startDate)
            let randomInterval = TimeInterval.random(in: 0...timeInterval)
            return startDate.addingTimeInterval(randomInterval)
        }

        let configuration = ModelConfiguration(isStoredInMemoryOnly: true)
        let container = try! ModelContainer(
            for: Transaction.self, configurations: configuration)
        
        var categoriesList: [Category] = []
        
        var accountList: [Account] = []
        
        
        for _ in 1...incomeCategoriesCount {
            let categoryName = Int.random(in: 0...(incomeCategoryNames.count - 1))
            let iconString = Int.random(in: 0...(sfSymbolsList.count - 1))
            
            let category = Category(name: incomeCategoryNames[categoryName], iconName: sfSymbolsList[iconString], type: "income", transactions: [])
            container.mainContext.insert(category)
            categoriesList.append(category)
        }
        
        for _ in 1...expenseCategoryCount {
            let categoryName = Int.random(in: 0...(expenseCategoryNames.count - 1))
            let iconString = Int.random(in: 0...(sfSymbolsList.count - 1))
            
            let category = Category(name: expenseCategoryNames[categoryName], iconName: sfSymbolsList[iconString], type: "expense", transactions: [])
            container.mainContext.insert(category)
            categoriesList.append(category)
        }
        
        for _ in 1...accountsCount {
            let accountName = Int.random(in: 0...(accountNames.count - 1))
            let iconString = Int.random(in: 0...(sfSymbolsList.count - 1))
            
            let account = Account(name: accountNames[accountName], iconName: sfSymbolsList[iconString], transactions: [])
            
            container.mainContext.insert(account)
            accountList.append(account)
        }
        
        let dateFormatter = DateFormatter()
        dateFormatter.dateFormat = "yyyy-MM-dd"
        
        for i in 1...transactionCount {
            let amount = round(Double.random(in: 1...1000) * 100) / 100
            let date = Calendar.current.startOfDay(for: randomDate(from: dateFormatter.date(from: "2024-10-01")!, to: dateFormatter.date(from: "2024-12-31")!)!)
            let description = "Description \(i)"
            let category = categoriesList.randomElement()!
            let account = accountList.randomElement()!
            
            let transaction = Transaction(amount: category.type == "expense" ? -amount : amount, date: date, description: description, category: category, account: account)
            
            container.mainContext.insert(transaction)
        }
        
        return container
    }
    
